new Date().getTime();</script><script type="text/javascript" nonce="c-aQTZi2VOqYVgKU01Pu8g">DOCS_modelChunk = [{"ty":"is","ibi":1,"s":"\nLAPORAN NARASI BULANAN\n\n*Mohon tuliskan aspek-aspek di bawah sesuai dengan petunjuk dan contoh yang ditandai dengan tulisan berwarna ungu. Sebelum mengirim, mohon untuk menghapus contoh. Laporan ini hanya membutuhkan waktu penyelesaian 50 MENIT\n\n\u0010\u0012\u001cNama Kelompok\n\u001c\n\u0012\u001cNama-nama Peserta\n\u001c\n\u0012\u001cTema Kegiatan\n\u001c\n\u0012\u001cPeriode Pelaporan\n\u001cContoh: September 2022\n\u0011\n\n\u0010\u0012\u001cHASIL PROGRAM\n\u001c\n\u001c\n\u001c\n\u001c\n\u0012\u001cObjektif: contoh: Mahasiswa berpartisipasi aktif dalam membangun kohesi sosial di masyarakat\n\u001c\n\u001c\n\u001c\n\u001c\n\u0012\u001cCapaian (Outcome)\nTuliskan hasil yang ingin dicapai melalui rangkaian aktivitas yang direncanakan\n\u001cLuaran (Output)\u000bTuliskan hasil langsung dari aktivitas yang dilaksanakan\n\u001c\n\u001c\n\u001c\n\u0012\u001c\n\u001cTarget\n\u001cProgres\n(Kategori terlaksana, dalam proses, tertunda, tidak terlaksana)\n\u001cPenyesuaian\u000bTuliskan jika ada penyesuaian aktivitas. Aktivitas tersebut dimasukan sebagai target pada laporan bulan berikutnya               \n\u0012\u001cContoh: \nOutcome 1:\nMahasiswa mengalami peningkatan pemahaman tentang persaudaraan antar pemeluk agama\n\u001cContoh:\nK1: Kunjungan ke rumah ibadah\n\u001cTidak terlaksana\n\u001c\nBermain board game\n\n\n\n\n\u0012\u001c\n\u001cK2:\n\u001c1 kali terlaksana\n\u001c\n\u0012\u001c\n\u001cR1:\n\u001c2 kali terlaksana\n\u001c\n\u0012\u001cOutcome 2:\n\u001c\n\u001c\n\u001c\n\u0012\u001cOutcome 3:\n\u001c\n\u001c\n\u001c\n\u0012\u001c\n\u001c\n\u001c\n\u001c\n\u0011\n\n\u0010\u0012\u001cAKTIVITAS\n\u001c\n\u001c\n\u001c\n\u0012\u001cNama Aktivitas\n\u001cTanggal Pelaksanaan\n\u001cDeskripsi Aktivitas\n\u001cJumlah Pihak yang terlibat\n\u0012\u001cSebutkan nama aktivitas yang dilaksanakan\n\u001c\n\u001cDeskripsikan aktivitas yang telah dilakukan, sertakan juga link dokumentasi \n\u001cTuliskan jumlah pihak yang terlibat, baik itu narasumber, peserta, dosen, LO, dan pihak pendukung yang relevan (segregasi gender)\n\u0012\u001cInspirasi: Sesi talkshow bersama budayawan\n\u001c13 September 2022\n\u001cSesi talkshow ini dilakukan untuk menggali pemahaman mahasiswa terkait peran budaya Pela Gandong dalam merawat keberagaman pemeluk agama. Narasumber yang terlibat adalah Bapak Johannes dari Komunitas Rawat Akur.  \n\nDokumentasi: [Tautan]\n\u001cLaki-laki:\u000b\u000bPerempuan:\n\u0011\n\n\u0010\u0012\u001cREFLEKSI KEBERJALANAN AKTIVITAS\n\u0012\u001cRefleksikan hal-hal yang menjadi tantangan dalam pelaksanaan kegiatan, serta upaya tindak lanjut yang telah dilakukan. Sertakan juga pembelajaran yang didapat sehingga dapat membuat proses implementasi dan pendampingan lebih baik\n\u0012\u001cContoh: \nPemberlakuan kembali PPKM membuat beberapa lokasi kunjungan yang direncanakan ditutup untuk sementara, dalam merespon hal tersebut, kami mencoba melakukan penyesuaian aktivitas kebhinekaan menjadi aktivitas dalam kelas\nSesi refleksi yang dilakukan bersama mahasiswa sangat bermakna dan efektif membangun rasa saling percaya di dalam kelompok. Hal ini menjadi praktik baik yang perlu terus di dorong   \n\u0011\n\n\n\u0010\u0012\u001cRENCANA AKTIVITAS BULAN BERIKUTNYA\n\u0012\u001cTuliskan rancangan aktivitas yang akan dilakukan di bulan berikutnya serta perkiraan tanggal pelaksanaan\n\u0012\u001cContoh: \nKontribusi sosial: Mengajarkan keberagaman melalui media kreatif di SD Pertiwi tanggal 16 Oktober 2022\n\u0011","sl":2817,"sh":2073320061},{"ty":"is","ibi":2819,"s":"\u0003\t\t\t\t\t\t\n","sl":8,"sh":597313351},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_ulhfl":false,"ds_hi":"kix.hf0"}},{"ty":"ae","et":"header-footer","id":"kix.hf0","epm":{"hfe_hft":2}},{"ty":"ae","et":"list","id":"kix.list.1","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":fals
